import React from 'react';
import { useState } from 'react';
import {NavDropDown, Nav, Container, Navbar} from 'react-bootstrap';
import '../App.css';
import Hamburger from 'hamburger-react';
import '../css/Header.css';

const Header =()=> {
  const [isOpen, setOpen] = useState(initialState);
  return (
        <Navbar expand='lg'>
          <Container>
            <Navbar.Brand href='#'>Cozy House
            <h6>Shelter for pets in Boston</h6>
            </Navbar.Brand>
            <Hamburger toggled={isOpen} toggle={setOpen} />
            <Navbar.Toggle aria-controls='basic-navbar-nav' onClick={()=>setOpen(!isOpen)} />
            <Navbar.Collapse className={isOpen ? 'show' : ''} id='basic-navbar-nav' style={{flexGrow: '0'}}>
              <Nav>
                <Nav.Link href='#'>About the shelter</Nav.Link>
                <Nav.Link href='#'>Our pets</Nav.Link>
                <Nav.Link href='#'>Help the shelter</Nav.Link>
                <Nav.Link href='#'>Contancts</Nav.Link>
              </Nav>
            </Navbar.Collapse>
          </Container>
        </Navbar>
  );
}
export default Header;
